import React from "react";
import { Container } from "react-bootstrap";
import CartMovies from "./moviesCart";
let movieList = () => {
    return (
        <Container>
                        <div className="moviescart">
                    <CartMovies></CartMovies>
                    <CartMovies></CartMovies>
                    <CartMovies></CartMovies>
            </div>
        </Container>
    )
}

export default movieList
